create table withdraw_applications
(
    id                      int unsigned auto_increment
        primary key,
    user_id                 int unsigned                           not null comment '申请人ID',
    change_id               int unsigned default 0                 not null comment '余额变动记录ID',
    user_name               varchar(64)                            not null comment '姓名',
    id_card                 varchar(64)                            not null comment '身份证信息',
    bank_name               varchar(255)                           not null comment '银行名称',
    withdraw_type           tinyint      default 0                 not null comment '提现方式：0：银行卡提现',
    withdraw_in_cents       int unsigned                           not null comment '提现金额',
    should_pay_in_cents     int unsigned                           not null comment '应付金额',
    service_charge_in_cents int unsigned                           not null comment '手续费金额',
    tax_in_cents            int unsigned                           not null comment '代扣税金额',
    bank_card_id            varchar(255)                           not null comment '银行卡号',
    withdraw_file_id        int unsigned                           null comment '提现凭证id',
    withdraw_file_url       text                                   null comment '提现凭证',
    tax_file_id             int unsigned                           null comment '扣税凭证id',
    tax_file_url            text                                   null comment '扣税凭证',
    rejection_comment       text                                   not null comment '驳回申请的备注',
    status                  tinyint      default 0                 not null comment '申请状态，0：申请未处理，2：申请已通过（需上传凭证），3：申请已拒绝',
    reviewer_id             int unsigned default 0                 not null comment '申请处理人ID',
    reviewed_at             datetime                               null comment '申请处理时间',
    created_at              datetime     default CURRENT_TIMESTAMP not null,
    updated_at              datetime                               null,
    deleted_at              datetime                               null
)
    collate = utf8mb4_unicode_ci;

create index withdraw_applications_status_index
    on withdraw_applications (status);

create index withdraw_applications_user_id_index
    on withdraw_applications (user_id);

create index withdraw_applications_withdraw_type_index
    on withdraw_applications (withdraw_type);

